      :doodle {
        @grid: 7 / 100vmax;
        background: #0a0c27;
      }
      @shape: clover 5;
      background: hsla(
        calc(360 - @i * 4), 70%, 68%, @r.8
      );
      transform:
        scale(@r(.2, 1.5))
        translate(@m2.@r(±50%));
    `}
